import React from "react";

const Navbar = ({ onLogout }) => {
  return (
    <nav
      style={{
        display: "flex",
        justifyContent: "space-between",
        padding: "10px",
      }}
    >
      <h2>ConnectPPL</h2>
      <button onClick={onLogout}>Logout</button>
    </nav>
  );
};

export default Navbar;
